import React from "react";

import "./PagingBtn.css";

const PagingBtn = () => {
  return (
    <div className="btnContainer">
      <div className="prevBtn bottomBtn">이전</div>
      <div className="nextBtn bottomBtn">다음</div>
    </div>
  );
};

export default PagingBtn;
